class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        if len(s) < 1 :
            return 0
        elif len(s)==1 :
            return 1
        b=0
        sub=s[b]
        maxsub=sub
        j=1
        while j!=len(s):
            if s[j] not in sub:
                sub = self.writedown(s,b,j)
                if len(sub) > len(maxsub):
                    maxsub = sub
                j+=1
            else:
                for m in range(0,j,1):
                    if s[j] == s[m]:
                        b=m+1
                sub = self.writedown(s,b,j)
                if len(sub) > len(maxsub):
                    maxsub = sub
                #b = j
                j+=1
        print(maxsub)
        return len(maxsub)
        
    def writedown(self,s,inital,last):
        cursub=""
        for i in range(inital,last+1,1):
            cursub = cursub + s[i]

        return cursub
